(27146, 60015, 0, 2, '01.Schizophrenia', '歌詞內容:\r\n一個精神分裂者，從懦弱進由冥想狀態轉變成為瘋狂的人格，多重人格拉扯之下，積壓已久的情緒終於爆發，這個社會不再有規範將他拘束。\r\n編曲方向:\r\n在民謠抒情、跳動新金屬、黑暗的黑死金屬、狂飆的速度金屬、哈扣式的吼叫之間不停切換，整首歌像精神分裂一樣，讓人摸不清聽不清，焦躁又平穩、強悍又溫婉。', '2010-06-05 00:00:00', 2000, 20, 0, 9, 'I close my eyes split it into twistet mind .\r\nForget before what I am inside . \r\nWon''t be remember , when sun go shine .\r\n(Wisper: \r\nLost my mind \r\nTheir all blind\r\nTo nowhere\r\nTwistet mind\r\nWhat''s inside )\r\n\r\nDarkness , that fill in me  to fill my empty .\r\nMadness , is anguishing me killing my reason .\r\nIllness , killing my last time of my life .\r\nSadness , pushing me falling into infinity .\r\n\r\nWake me up in the dream of reality .\r\nTorn in two split personality that sets me free .\r\n\r\nDarkness , that fill in me  to fill my empty .\r\nMadness , is anguishing me killing my reason .\r\nIllness , killing my last time of my life .\r\nSadness , pushing me falling into infinity .\r\n\r\nI am a man who lives a day with 48 .\r\nI am a man who lives a life in second hand .\r\nI am a man who face the fact with twisted mind .\r\nI am a man who lives in world with double soul .\r\n\r\nWake me up in the dream of reality .\r\nTorn in two split personality that sets me free .\r\npersonality mother fucker sets me free .\r\n\r\nI close my eyes split it into twistet mind .\r\nForget before what I am inside . \r\nWon''t be remember , when sun go shine .\r\n(Yell: \r\nLost my mind \r\nTheir all blind\r\nTo nowhere\r\nTwistet mind\r\nWhat''s inside )\r\n\r\nA name you call schizophrenia .\r\nA name you call schizophrenia .\r\nA name you call schizophrenia .\r\nA name you call schizophrenia . \r\nSchizophrenia .\r\n\r\n---------------------------------------------全文譯----------------------------------\r\n我閉上眼分離出兩種思想\r\n忘記我的內在曾為何物\r\n旭日東昇時我也不會被記得\r\n(低語:\r\n失心瘋\r\n它們全瞎了\r\n到不毛之地\r\n異心\r\n裡面是什麼)\r\n\r\n黑暗，填滿了我的空虛\r\n神智瘋狂，折磨著我使我失去理性\r\n病入膏肓，扼殺著我剩餘的生命\r\n悲傷，令我墜入萬劫不復\r\n\r\n把我從現實的夢叫醒\r\n哭成為雙重人格、解放自我\r\n\r\n黑暗，填滿了我的空虛\r\n神智瘋狂，折磨著我使我失去理性\r\n病入膏肓，扼殺著我剩餘的生命\r\n悲傷，令我墜入萬劫不復\r\n\r\n我是個一天過48小時的人\r\n我是個活在二手生命的人\r\n我是個面對事實有雙重標準的人\r\n我在這世上是個擁有雙重靈魂的人\r\n\r\n把我從現實的夢叫醒\r\n哭成為雙重人格、解放自我\r\n雙重人格、他媽的解放我\r\n\r\n我閉上眼分離出兩種思想\r\n忘記我的內在曾為何物\r\n旭日東昇時我也不會被記得\r\n(怒吼:\r\n失心瘋\r\n它們全瞎了\r\n到不毛之地\r\n異心\r\n裡面是什麼)\r\n\r\n你們稱我作精神分裂\r\n你們稱我作精神分裂\r\n你們稱我作精神分裂\r\n你們稱我作精神分裂，精神分裂', '', 252, '', '底火', '張逸塵', '張逸塵', '', '', 0, 0, 1, '2010-08-15 23:49:07', '2013-10-07 17:16:52', '0000-00-00 00:00:00'),
(27147, 60015, 0, 3, '02.End Up The World', '歌詞內容:\r\n愚蠢的人類總是被害妄想自以為將有外太空來的高等文明要毀滅地球，但人類的破壞力遠過於宇宙上任何高等生物，我們一點一滴的殘殺著我們的大地之母，End Up The World就是我們每分每秒再做的事。\r\n這首歌是以反諷為出發的勸世歌曲。\r\n編曲方向:\r\n以新金屬編曲編排為骨、放克節奏為肉、前衛元素為血、哈扣為皮，合成的一首歌。以放克Riff帶動節拍再引爆出更強悍的Riff，中段用7/8拍為變奏，最後在一次新金屬配上哈扣式的大爆炸。', '2010-06-05 00:00:00', 2000, 20, 0, 9, '你們什麼都不會，只會看電視\r\nMother Fucker \r\n你們什麼都不會，只會喝醉酒\r\nMother Fucker \r\n你們什麼都不會，只會追潮流\r\nMother Fucker \r\n你們什麼都不會，只會選總統\r\n或許不用等到，2012來到，我們就能看到，天國提早來到\r\n我們總是睜一隻眼閉一隻眼假裝看不到、聽不到把地球毀滅掉\r\n\r\nEnd up the fuckin world .(譯:終結他媽的世界)\r\nEnd up the fuckin world .\r\nEnd up the fuckin world .\r\nEnd up the world .\r\n\r\nThe world will end by our hand .(譯:世界將終結在我們手上)\r\nThe world will end by our hand .\r\nThe world will end by our hand .\r\nThe world will end by our hand .\r\n\r\nAfsa Afsa Maliun Gisu  (阿美族語:膩了，膩了，你們講都講不聽)\r\nAfsa Afsa Maliun Gisu\r\nAfsa Afsa Maliun Gisu\r\nAfsa Afsa \r\n\r\nYou want to stay alive , you better realize.\r\nYou can run can hide or stand up and fight .\r\nThe game is on you better choose your style \r\nat live that determinant your dead style .\r\n(譯:你想活著，你最好清楚的了解\r\n你可以逃走、可以躲避、或者站起來戰鬥\r\n遊戲已經開始了你最好選擇你該怎麼活\r\n因為你怎麼活就決定你將怎麼死)\r\n\r\nThe world will end by our hand .(譯:世界將終結在我們手上)\r\nThe world will end by our hand .\r\nThe world will end by our hand .\r\nThe world will end by our hand .', '', 190, '', '底火', '張逸塵', '張逸塵', '底火', '', 0, 0, 1, '2010-08-16 03:25:08', '2013-10-07 17:16:52', '0000-00-00 00:00:00'),
(27148, 60015, 2577, 3, '03.Saṃsāra', '歌詞內容:\r\n神秘的埃及古文明，黑暗的金字塔下，埋藏著無數陪葬者與一尊尊的法老木乃伊。\r\nMummy這首歌訴說著一具屍體從死亡到製作成木乃伊、入棺安葬、在地下世界依然統治著他的領土、接著藉由輪迴轉世又再次回到人間接受生老病死的詛咒。\r\n編曲方向:\r\n以三全音調式音階貫穿整首歌，由緩至重、再由重漸緩。開頭與尾聲繚繞的野性民族聲樂，讓人永遠脫離不了Mummy的魔咒。', '2010-06-05 00:00:00', 2000, 20, 0, 7, '@\r\nFall through the dark ,\r\nto the underworld .\r\nLeaving the light of the day .\r\nNow I lay cold \r\nin this chamber of stone .\r\nForsaken the power of my throne .\r\n\r\nThe mask of death I wear .\r\nWho dares to invade my land .\r\n#\r\nFeel the blood flow through my skin .\r\nThe life force shines in me again .\r\nVisions of the future world appear .\r\nReturn to that fatal cursed day .\r\n\r\n@\r\n#\r\n#\r\n#\r\n\r\n------------------------------------------------------全文譯----------------------------------\r\n穿過黑暗\r\n進入地底世界\r\n離開白天的陽光\r\n我現在正躺在石頭做成的房間中\r\n遺棄了我王座上的權利\r\n\r\n我穿戴著的是象徵死亡的面具\r\n誰還膽敢侵犯我的領土\r\n\r\n感受著血液流動穿過我的皮膚\r\n生命之光再次照耀了我\r\n未來世界的畫面呈現在我眼前\r\n再次回到這受命運擺佈的詛咒世界', '', 303, '', '底火', '張逸塵', '張逸塵', '底火', '', 0, 1, 0, '2010-08-16 03:25:41', '2015-03-12 13:43:21', '0000-00-00 00:00:00'),
