(27150, 71444, 0, 1, '黑暗崇拜', '', '2010-08-16 00:00:00', 2000, 10, 0, 7, '俯瞰著他的眼 說著謊言\r\n每個人嘴裡說的笑著  \r\n崇尚現實的虛偽\r\n他搖著尾巴噘起嘴唇跑到被窩裡面\r\n要瘋的笑著哭著叫著\r\n你到底扮演什麼腳色\r\n每當你醒過來\r\n都早忘記自己是誰\r\n\r\n試探著他的眼 說著懺悔\r\n他喃喃自語說的笑著\r\n逃避懦弱的自卑\r\n顫抖的身軀拭去眼淚渴望得到赦免\r\n快認不清自己的面孔\r\n我還要扮演什麼腳色\r\n每當我醒過來\r\n都早忘記自己是誰\r\n\r\n黑暗崇拜 你的心 掩蓋著你的可憐\r\n別再耍賴 太噁心 厭惡的嘴臉\r\n黑暗崇拜 回不去 就此淪陷 \r\n灰色地帶 名和利 \r\n他吞噬著你的信賴 黑的心 矇蔽了雙眼\r\n黑暗崇拜 沒了情\r\n宣示著你的失敗 愧了心 麻木的笑靨\r\n黑暗崇拜 逃不出來\r\n\r\n偽裝的面具我看不懂\r\n徘迴在身邊卻摸不透', '', 244, '', '宏澧', '宏澧', '宏澧', '阿克曼樂團', '', 0, 1, 0, '2010-08-16 13:55:15', '2015-03-12 13:43:21', '0000-00-00 00:00:00'),
