(27165, 23807, 0, 1, '2010July', '紀念我在七月過世的堂姊。', '2010-08-18 00:00:00', 2000, 0, 2, 6, '終會有那一天，\r\n你總會離開，放下一切，\r\n只是想不到來得那麼快，\r\n你閉上雙眼，沒有揮手。\r\n\r\n像一首歌還沒到最後，\r\n卻突然落下終止的和弦。\r\n我還想一直一直的去唱，\r\n屬於你的歌，\r\n一直的唱。\r\n\r\n不願去想點滴的回憶，\r\n為何憂傷這時變得如此巨大？\r\n捨不得你離開，\r\n卻又不想你繼續痛苦。\r\n\r\n\r\n終於在那一天，\r\n你轉身離開，放下一切，\r\n放下苦痛，放下折磨，\r\n你離開凡間，沒有揮手。\r\n\r\n像一本書最後的幾頁，\r\n雖然不完美又讓人惆悵，\r\n但是我們不得不放下已讀完的書，\r\n接續下人生。\r\n\r\n你曾說過：別限制自己。\r\n為何這句話這時變得如此巨大？\r\n像雷聲在空氣中不斷迴盪，\r\n震撼我的心。', '', 360, '', '阿光', '阿光', '阿光', '', '', 0, 1, 0, '2010-08-18 06:45:35', '2015-03-12 13:43:21', '0000-00-00 00:00:00'),
