(27235, 1788, 2715, 1, '17', '', '2010-08-21 00:00:00', 2000, 10, 0, 7, '\r\n醒來又在同樣場景\r\n好想一些好聽噪音\r\n打破我的世界打破你的所有表情\r\n\r\n外面又開始下大雨\r\n心情就不用再下雨\r\n只要漂浮繽紛空氣之中就很開心\r\n\r\n就甩開節奏 就甩開旋律\r\n現在只要dancing dancing dancing 17\r\n\r\n不需要美麗 不需要實力\r\n我們一起dancing dancing dancing 17\r\n\r\n你要冷漠你要熱情你要什麼都沒關係\r\n我的快樂我的悲傷我的憤怒我的自卑\r\n全部 通通 不用 客氣 都拿去!!\r\n', '', 248, '', '張天偉', '張天偉', '', '', '', 1, 1, 0, '2010-08-21 23:04:50', '2015-03-12 13:43:23', '0000-00-00 00:00:00'),
(27236, 1788, 2715, 3, 'Jero''s Wet Dream', '', '2010-08-21 00:00:00', 2000, 10, 0, 7, '想像著你在我身邊 帶著一張平淡的臉\r\n慢慢走到我的面前 看著我呆呆的笑臉\r\n\r\n於是我牽起你的手 走向一片美麗的森林\r\n那是最美麗的風景 就像你的透明的眼睛\r\n\r\n我知道這全都是夢 我也忘了是第幾次的夢\r\n這種問題別來煩我 我只想做在夢裡面的我\r\n\r\n拜託不要讓我醒來 我還不想就這樣醒來\r\n虛幻色彩多麼燦爛 無聊現實就丟在窗外\r\n\r\nso take me away\r\n(閉上眼 在夢裡 你帶我離開 離開這裡 飛過了地平線之外)\r\njust take me away\r\n(那裡有最舒服的顏色淡藍 你的笑容我卻還不能夠明白)\r\nso tell me a way\r\n(突然又在同樣場景中醒來 看著眼前熟悉的白色天花板)\r\njust tell me a way\r\n(其實也不用覺得太過意外 你和我也一起活在同個窗外)', '', 287, '', '張天偉', '張天偉', '', '', '', 1, 1, 0, '2010-08-21 23:11:11', '2015-03-12 13:43:23', '0000-00-00 00:00:00'),
(27237, 1788, 2715, 2, '少年嘴角滲著血', '', '2010-08-21 00:00:00', 2000, 10, 0, 7, '他拿著鉛筆 寫著不知所云\r\n聽著音樂 假裝可以填補空虛\r\n看著鏡子 裡面搖頭晃腦表情\r\n也許這次 可以真的喜歡自己\r\n\r\n那些話題 可能他也會有興趣\r\n那些旋律 可能他會覺得好聽\r\n不要再問 太多艱深複雜問題\r\n只要趕快帶他逃離這裡就行\r\n\r\n請別離開 請別走開\r\n我只是想一起狂歡\r\n\r\n請告訴我 快告訴我\r\n我到底應該要怎麼做\r\n\r\n不要再問 不要再說\r\n我已經無法再決定什麼\r\n\r\n你的眼神刺穿我的喉嚨\r\n把所有原本全部的我都帶走\r\n', '', 240, '', '張天偉', '張天偉', '', '', '', 1, 1, 0, '2010-08-21 23:19:11', '2015-03-12 13:43:23', '0000-00-00 00:00:00'),
